import React from "react";
import styled from 'styled-components/native';

const Header = ({ title }) => {
    return (
        <Wrapper>
            <Title>{title}</Title>
        </Wrapper>
    );
}

export default Header;

const Wrapper = styled.View`
  width:100%;
  flex-direction: row;
  background-color: gray;
  align-items: center;
  padding-bottom: 10px;
`;

const Title = styled.Text`
  font-size: 25px;
  padding-horizontal: 10px;
`;
